import React, { Component } from 'react'

import Card from './component/card';
export default class noticia extends Component {
  render() {
    return (
     <div className="noticia">
       <div className="logo">
       <strong>Noticia</strong> 
       </div>
       <div className="link">
         <h2>Home</h2>
         <h2>Pokedex</h2>
       </div>
       <div>
          <Card/> 
       </div>
     </div>

    )
  }
}
